import React, { Component } from 'react';
import './App.css';
import DogSpan from './DogSpan'

pupsUrl = 'http://localhost:3000/pups/'

class App extends Component {

  state = {
    dogs: []
  }

  componentDidMount(){
    fetch(pupsUrl)
    .then(res => res.json())
    .then(dogsArray => {
      console.log(dogsArray)
    })
  }

  render() {
    return(
    <div className="App">
      <div id="filter-div">
        <button id="good-dog-filter">Filter good dogs: OFF</button>
      </div>
      <div id="dog-bar">
      <DogSpan />
      </div>
      <div id="dog-summary-container">
        <h1>DOGGO:</h1>
        <div id="dog-info">

        </div>
      </div>
    </div>
    )
  };
}

export default App;
